import React from 'react'
import GetAllEquities from './equities/GetAllEquities'
import Card from './Card'


const Home = () => {
  return (
    <div>
      <h2>Security Master</h2>
      {/* <SecuritySummaryTab/> */}
      {/* <EquityTabs/> */}
      {/* <BondsTabs/> */}
      {/* <h1>Home Page under construction</h1> */}
      <Card children={<GetAllEquities/>, <GetAllBonds/>}/>
    </div>
  )
}

export default Home
